message:
QUERY: %c%s font-weight: bold query ($moduleSlug: String!) {
    carousel(where: {moduleSlug: $moduleSlug}) {
        id
        carouselName
        moduleSlug
        carouselSlides {
          ... slideFields
        }
    }
}

fragment slideFields on CarouselSlide {
  id
  newTab
  wideImage {
    fileName
    height
    url(transformation: {image: {resize: {width: 1920, height: 600}}})
  }
  showText
  slideText
  slideTitle
  ctaText
  textAlign
  textPosition
  slideUrl
  mobileImage {
    height
    url(transformation: {image: {resize: {height: 600, width: 400}}})
    fileName
  }
} @ [object Object]

VARIABLES: %c%s

sending as json font-weight: bold {
  "moduleSlug": "homepage-carousel"
} {moduleSlug: homepage-carousel} @ [object Object]

